import React from 'react'
import '../styles/boton.css'

class Boton extends React.Component{
    /*
    constructor(props){
        super(props)
        this.state={props}
    }
    */
    render(){
        return(
            <a className="container-boton" href="/page/new">
                <div className="boton-add">
                    <div className="text-center">+</div>
                </div>
            </a >
        )
    }
}

export default Boton
